import { HttpClient, HttpErrorResponse } from "@angular/common/http";
import { Injectable } from "@angular/core";
import { EmailSettings } from "src/models/emailSettings";


@Injectable({
    providedIn: 'root'
})
export class EmailSettingsService{
    
    constructor(private http:HttpClient){}

    getGeneralProperties(){
        
        return this.http.get('/api/emailsettings/general');
    }

    setNewEmailSettings(data: EmailSettings){
        return this.http.post<EmailSettings>('/api/emailsettings/setgeneral', data).subscribe(
            (response: any) => {
              return response;
              // Handle successful response\
              console.log('POST request successful:', response);
            },
            (error: HttpErrorResponse) => {
              // Handle error
              if (error.error instanceof Error) {
                // Client-side error occurred
                console.error('An error occurred:', error.error.message);
              } else {
                // Server-side error occurred
                console.error('Server returned error:', error.status, error.statusText);
              }
            }
          );;
    }
}
